import React from "react";
import {
    Button,
    Dialog, DialogActions, DialogContent, DialogTitle
} from "@mui/material";

export default class MaterialDialog extends React.Component {
    constructor(props){
        super(props);

        this.state = {
         dialogOpen: false
        }
    }
    render() {
        return (
            <div>

                <Button
                  onClick={()=>{
                      this
                  }}
                >
                    Open Dialog
                </Button>
               <Dialog
                 open={this.state.dialogOpen}
               >
                   <DialogTitle>
                       My Title                  
                   </DialogTitle>
                   <DialogContent>
                        Do you agree with the content
                   </DialogContent>
                   <DialogActions>
                       <Button>
                           Agree
                       </Button>
                   </DialogActions>
               </Dialog>
            </div>
        )
    }
}
